import React from 'react';
import { Container, Grid, Link, makeStyles,Typography} from '@material-ui/core'

const useStyles = makeStyles((theme) => ({
    page: {
       textAlign: 'center',
    },
}))
export default function Community() {
    const classes=useStyles();
    return (
        <Container className={classes.page}>
            <div>
                <Typography variant="h1">404 Error</Typography>
            </div>
            <div>
                <Typography variant="h3">Trang này không tồn tại!</Typography>
            </div>
            <div>
                <Typography variant="h5" color="s">Nếu bạn cho rằng đây là vấn đề của chúng tôi, vui lòng cho chúng tôi biết.</Typography>
                <Link href="/gioithieu">Liên hệ</Link>
            </div>
        </Container>
    )
}
